import numpy as np
import tensorflow as tf
import pickle
import dnnlib.tflib as tflib
import dnnlib
from training.networks_stylegan import G_style, D_basic
from vgg16_zhang_perceptual import lpips_network

_latents = np.array(_latents).reshape([-1,512])
_latents = np.expand_dims(_latents, axis=0)

def _many(x):
    try:
        if type(x) in [str, bytes]:
            return False
        xit = iter(x)
        return True
    except TypeError as te:
        return False

def _listify(x):
  return x if _many(x) else [x]

def _load_network(session, network, func):
  with session.as_default():
    net = tflib.Network(network.name, func, **network.static_kwargs)
    net.copy_compatible_trainables_from(network)
    return net

def open_url(
    url,
    func = None,
    session = None,
    cache_dir = 'cache'):
  assert func is not None
  session = session or tf.get_default_session()
  with session.as_default():
    with dnnlib.util.open_url(url, cache_dir='cache') as f:
      n = pickle.load(f)
    if _many(n):
      return tuple([_load_network(session, x, f) for x, f in zip(n, func if _many(func) else [func]*len(n))])
    else:
      return _load_network(session, n, list(func)[0] if _many(func) else func)

def load_model(
    url = 'https://drive.google.com/uc?id=1MEGjdvVpUsu1jB4zrXZN7Y4kBBOzizDQ', # karras2019stylegan-ffhq-1024x1024.pkl
    session = None,
    cache_dir = 'cache'):
  session = session or tf.get_default_session()
  with session.as_default():
    with dnnlib.util.open_url(url, cache_dir='cache') as f:
      _G, _D, _Gs = pickle.load(f)
    G = tflib.Network(_G.name, G_style, **_G.static_kwargs)
    G.copy_vars_from(_G)
    D = tflib.Network(_D.name, D_basic, **_D.static_kwargs)
    D.copy_vars_from(_D)
    Gs = tflib.Network(_Gs.name, G_style, **_Gs.static_kwargs)
    Gs.copy_vars_from(_Gs)
    # prep the network.
    #synthesis_kwargs = dict(output_transform=dict(func=tflib.convert_images_to_uint8, nchw_to_nhwc=True), minibatch_size=8)
    #images = Gs.components.synthesis.run(_latents, randomize_noise=False, **synthesis_kwargs)
    #import pdb
    #pdb.set_trace()
    return G, D, Gs

def load_perceptual(
    url = 'https://drive.google.com/uc?id=1N2-m9qszOeVC9Tq77WxsLnuWwOedQiD2', # vgg16_zhang_perceptual.pkl
    session = None,
    cache_dir = 'cache'):
  session = session or tf.get_default_session()
  with dnnlib.util.open_url(url, cache_dir='cache') as f:
    _P = pickle.load(f)
  with session.as_default():
    P = tflib.Network(_P.name, lpips_network, **_P.static_kwargs)
    P.copy_vars_from(_P)
    return P

